  const headers = [['Поздравлялки', 'In Memory Of'], ['Видеосообщение','Голосовушки']]
  return (
    <main>
      <div className="header"></div>
      <div className="body">
        <Container hText={headers[0]} type={0} cName={'wbox_wrapper'}/>
        <Container hText={headers[1]} type={1} cName={'wbox_wrapper wb1'}/>
      </div>
    </main>
  );
}

export default App;
